import React from "react";

import { Form, FormGroup, Label, Input, FormText } from "reactstrap";

const Login = () => {
  return (
    <Form>
      <FormGroup>
        <Label for="userName">UserName</Label>
        <Input
          type="text"
          name="username"
          id="userName"
          placeholder="username"
        ></Input>
      </FormGroup>
    </Form>
  );
};

export default Login;
